// import logo from '../logo.svg';
// import './App.css';

import React from "react";
import Header from "./Header";
import Main from "./Main";
import Footer from "./Footer";
import PopupWithForm from "./PopupWithForm";

function App() {
  return (
    <div className="page">
      <Header />

      <Main />

      <Footer />

      <PopupWithForm name="profile" title="Редактировать профиль">
        <input
          id="input-name"
          name="name"
          type="text"
          placeholder="Имя"
          className="popup__input popup__input_type_name"
          minLength={2}
          maxLength={40}
          required=""
        />
        <span className="popup__error input-name-error" />
        <input
          id="input-about"
          name="about"
          type="text"
          placeholder="О себе"
          className="popup__input popup__input_type_about"
          minLength={2}
          maxLength={200}
          required=""
        />
        <span className="popup__error input-about-error" />
      </PopupWithForm>

      <PopupWithForm
        name="places"
        title="Новое место"
        buttonSave="Создать"></PopupWithForm>

      <PopupWithForm name="avatar" title="Обновить автар"></PopupWithForm>

      <PopupWithForm
        name="delete"
        title="Вы уверены?"
        buttonSave="Да"></PopupWithForm>

      <PopupWithForm name="photo" title="Редактировать профиль"></PopupWithForm>
    </div>
  );
}

export default App;
